const calculator = () => {
  const startDate = document.getElementById("start_date");
  const endDate = document.getElementById("end_date");
  if (startDate != null) {
    startDate.addEventListener("change", () => {
      console.log(startDate.value);
    });
  }
}
export default calculator;
